@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],

})
export class AppComponent {
  title = 'AngularApp';
}
<app-card-contatos></app-card-contatos>
<app-cadastro-imovel></app-cadastro-imovel>
<div class="col-md-6" style="margin-top: 10rem;">
    <app-cadastro-imovel></app-cadastro-imovel>
</div>
